import React from 'react';

function Home() {

    function search(){
        let value = document.getElementById("search");
        
    }

    return (
        <div>
            <div className="sider">
                <div>
                    <input type="text" id='search' />
                    <button onClick={search} className='btn btn-warning'>search</button>
                </div>
            </div>
        </div>
    );
}

export default Home;
